import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className="header bg-primary text-secondary">
      <h1>One Flow Stream</h1>
      <div className="dropdown">
        <ul>
          <li class="nav-item" ><Link to="/">Inicio</Link></li>
          <li class="nav-item" ><i class="fas fa-plus"></i><Link to="/about">About</Link></li>
        </ul>
      </div>
    </div>
  );
};

export default Header;

